import { Route, Routes } from "react-router-dom";
import "./App.css";
import Login from "./pages/login/Login";
import Product from "./pages/product/Product";

function App() {
  return (
   <Routes>
    <Route path="/" element={<Login /> }/>
    <Route path="/product" element={<Product /> }/>
   </Routes>

  );
}

export default App;
